exports=async function(url,bid,cid,options){const{parseContent}=await require("transcode/parse_content");return parseContent(url,"#chaptercontent",{clientOptions:{...(options&&options.clientOptions)},transformer:f=>f.replace(/<p>[^<\s]+ https?:\/\/[^<]+\/index\.html<\/p>/,""),preprocess:h=>h.replace(/id="chaptercontent"[^>]*>\s*<div[^>]*>\s*<div>[^<]+<\/div>\s*<\/div>/,"id=\"chaptercontent\">")})};